/answerInlineQuery?inline_query_id=9095715782995964283&results=[{"type":"article","id":"012","title":"<\u043c\u0435\u0441\u0442\u043e\u0438\u043c.> 1. \u0432\u0443\u0447; {\u0447\u0442\u043e \u044d\u0442\u043e \u0442\u0430\u043a\u043e\u0435}? \u0438\u043c \u0432\u0443\u0447 \u044f? {\u0447\u0435\u0433","input_message_content":{"message_text":"<\u043c\u0435\u0441\u0442\u043e\u0438\u043c.> 1. \u0432\u0443\u0447; {\u0447\u0442\u043e \u044d\u0442\u043e \u0442\u0430\u043a\u043e\u0435}? \u0438\u043c \u0432\u0443\u0447 \u044f? {\u0447\u0435\u0433\u043e \u0442\u044b \u0436\u0434\u0451\u0448\u044c}? \u0432\u0443\u043d\u0430 \u0432\u0443\u0447 \u0433\u0443\u044c\u0437\u043b\u0435\u043c\u0438\u0448\u0437\u0430\u0432\u0430? {\u0447\u0435\u043c\u0443 \u0442\u044b \u0441\u043c\u0435\u0451\u0442\u0441\u044f}? \u0432\u0443\u043d \u043a\u043a\u0432\u0435\u043b \u0445\u044a\u0443\u044c\u0440\u0435\u0437\u0432\u0430? {\u0447\u0435\u043c}? \u043a\u043a\u0432\u0435\u043b\u0434\u0438? {\u043e \u0447\u0451\u043c?} \u043a\u043a\u0432\u0435\u043a\u0430\u0439? \u043a\u043a\u0443\u044c\u043d \u0433\u044c\u0430\u043a\u044a\u0438\u043d\u0434\u0430\u0439? {\u043d\u0430 \u0447\u0451\u043c}? \u043a\u043a\u0432\u0435\u043b?.\r\n\r\n2. \u0433\u044c\u0438\u043aI \u044f? \u0433\u044c\u0438\u043aI \u0445\u044c\u0430\u043d\u0430? \u0432\u0443\u0447 \u0445\u044c\u0430\u043d\u0430? {\u043d\u0443 \u0447\u0442\u043e \u0436\u0435, \u0442\u044b \u0435\u0434\u0435\u0448\u044c}? \u0433\u044c\u0430\u043d \u0433\u044c\u0438\u043aI \u0445\u044c\u0430\u043d\u0430, \u0432\u0443\u043d \u0444\u0438\u0437\u0432\u0430\u043d\u0438?.\r\n\r\n3. \u0432\u0443\u0447? \u0432\u0443\u0447\u0438\u0437? {\u0447\u0442\u043e \u0442\u044b \u043b\u0435\u0436\u0438\u0448\u044c}? \u0432\u0443\u043d \u0432\u0443\u0447\u0438\u0437 \u043a\u044a\u0430\u0442\u043a\u0430\u043d\u0432\u0430?.\r\n\r\n4. \u0432\u0443\u0447? \u0433\u044c\u0438\u043a\u044c\u0432\u0430\u043d? \u043a\u043a\u0443\u044c\u043d?; {\u0447\u0442\u043e \u0441\u0442\u043e\u0438\u0442 \u044d\u0442\u0430 \u043a\u043d\u0438\u0436\u043a\u0430}? \u0438 \u043a\u0442\u0430\u0431 \u043a\u043a\u0443\u044c\u043d \u043a\u0432\u0430?.\r\n\r\n5. \u0441\u0430 \u043a\u0430\u0440; \u0441\u0430 \u0437\u0430\u0442I; {\u0435\u0441\u043b\u0438 \u0447\u0442\u043e \u0441\u043b\u0443\u0447\u0438\u0442\u0441\u044f, \u044f \u043d\u0435 \u043e\u0442\u0432\u0435\u0447\u0430\u044e} \u043d\u0430\u0433\u0430\u0433\u044c \u0441\u0430 \u043a\u0430\u0440 \u0445\u044c\u0430\u0439\u0438\u0442I\u0430, \u0437\u0430 \u0436\u0430\u0432\u0430\u0431 \u0433\u0443\u0434\u0430\u0447. \u2666 {\u0432\u043e\u0442 \u0447\u0442\u043e} 1) \u0438\u043d\u0433\u044c\u0435 \u0438\u043aI; 2) \u0432\u0443\u043d\u0430 \u0432\u0443\u0447 \u0430\u044f\u043d\u0438, \u0437\u0430\u0437 \u043a\u0438\u043b\u0438\u0433, \u044f\u0431 \u0446\u0435; {\u0447\u0442\u043e \u0434\u043e \u043c\u0435\u043d\u044f} \u0437\u0443\u043d \u043b\u0430\u0433\u044c\u0430\u0439\u0442I\u0430, \u0437\u0430\u043a\u0430\u0439 \u0440\u0430\u0445\u0430\u0439\u0442I\u0430, \u0437\u0430\u043b \u0433\u044c\u0430\u043b\u0442\u0430\u0439\u0442I\u0430; {\u043d\u0438 \u0437\u0430 \u0447\u0442\u043e} \u0433\u044c\u0438\u0447, \u043a\u044c\u0435\u0439\u0438\u0442I\u0430\u043d\u0438, \u0432\u0443\u0447 \u0433\u0430\u0439\u0438\u0442I\u0430\u043d\u0438, \u0432\u0443\u0447 \u0430\u0432\u0443\u0440\u0442I\u0430\u043d\u0438; {\u043d\u0438 \u0437\u0430 \u0447\u0442\u043e, \u043d\u0438 \u043f\u0440\u043e \u0447\u0442\u043e} \u0433\u044c\u0430\u043aI \u0441\u0430 \u043a\u0430\u0440\u043d\u0438 \u0430\u0432\u0430\u0447\u0438\u0437, \u043d\u0430\u0433\u044c\u0430\u043a\u044c, \u0433\u044c\u0430\u0432\u0430\u0439\u0434\u0430; {\u043d\u0438 \u043a \u0447\u0435\u043c\u0443} \u0433\u0435\u0440\u0435\u043a \u0442\u0443\u0448, \u0433\u0435\u0440\u0435\u043a \u0430\u0432\u0430\u0447; {\u0441 \u0447\u0435\u0433\u043e}? \u0432\u0443\u0447\u0438\u0437? \u0432\u0443\u0447 \u0441\u0435\u0431\u0435\u0431\u0434\u0430\u043b\u0434\u0438? {\u043f\u043e\u043a\u0430 \u0447\u0442\u043e} \u0433\u044c\u0435\u043b\u0435\u043b\u0438\u0433; {\u043f\u043e\u0447\u0442\u0438 \u0447\u0442\u043e} \u0441\u0430\u043a\u0438; {\u043d\u0443, \u0447\u0442\u043e \u0436\u0435} \u043c\u0430\u0434 \u0432\u0443\u0447 \u0438\u0439\u0438\u0434\u0430 \u043a\u044c\u0432\u0430\u043d; {\u0447\u0442\u043e \u0431\u044b \u043d\u0438 \u0431\u044b\u043b\u043e} \u0432\u0443\u0447 \u0445\u044c\u0430\u0439\u0438\u0442I\u0430\u043d\u0438; {\u0447\u0442\u043e \u0442\u044b}! \u0432\u0443\u043d\u0430 \u0432\u0443\u0447 \u043b\u0443\u0433\u044c\u0443\u0437\u0432\u0430! \u0432\u0430\u0437 \u0432\u0443\u0447 \u0445\u044c\u0430\u043d\u0432\u0430! {\u0447\u0443\u0442\u044c \u0447\u0442\u043e} \u0441\u0430 \u0436\u0438\u0437\u0432\u0438\u0434\u043b\u0430\u0439, \u0441\u0430 \u0436\u0438\u0437\u0432\u0438 \u043a\u0430\u0440 \u0445\u044c\u0430\u043d\u0430\u043c\u0430\u0437\u0434\u0438, \u0441\u0430 \u0436\u0438\u0437\u0432\u0438 \u043c\u0430\u043b\u0443\u043c \u0445\u044c\u0430\u043d\u0430\u043c\u0430\u0437\u0434\u0438.","parse_mode":"Markdown"}},{"type":"article","id":"112","title":"<\u0441\u043e\u044e\u0437 >1. \u0445\u044c\u0438; \u043b\u0430\u0433\u044c\u0430\u043d\u0430 (\u0433\u0437\u0430\u0444 \u0432\u0430\u0445\u0442\u0430\u0440\u0430 \u043f\u0435\u0440\u0435\u0432\u043e\u0434 \u0438\u0439\u0438\u0434\u0430","input_message_content":{"message_text":"<\u0441\u043e\u044e\u0437 >1. \u0445\u044c\u0438; \u043b\u0430\u0433\u044c\u0430\u043d\u0430 (\u0433\u0437\u0430\u0444 \u0432\u0430\u0445\u0442\u0430\u0440\u0430 \u043f\u0435\u0440\u0435\u0432\u043e\u0434 \u0438\u0439\u0438\u0434\u0430\u0447); {\u043e\u043d \u043e\u0442\u0432\u0435\u0442\u0438\u043b, \u0447\u0442\u043e \u043e\u043d\u0438 \u0443\u0435\u0445\u0430\u043b\u0438} \u0430\u0434\u0430, \u0430\u0431\u0443\u0440 \u0445\u044a\u0444\u0435\u043d\u0430 \u043b\u0430\u0433\u044c\u0430\u043d\u0430, \u0436\u0430\u0432\u0430\u0431 \u0433\u0430\u043d\u0430; {\u043e\u043d \u0443\u0432\u0438\u0434\u0435\u043b, \u0447\u044