\u0438\u0434\u0430\u0439\u0434\u0438 \u044f..\r\n\r\n5. -\u0430\u043b; {\u043a \u0442\u0440\u0451\u043c \u043f\u0440\u0438\u0431\u0430\u0432\u044c \u043f\u044f\u0442\u044c }\u043f\u0443\u0434\u0430\u043b \u0432\u0430\u0434 \u044d\u0446\u0438\u0433..\r\n\r\n6. -\u043a\u0430\u0439; {\u043e\u043d \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0438\u0442 \u043a \u0447\u0438\u0441\u043b\u0443 \u043d\u043e\u0432\u044b\u0445 \u043b\u044e\u0434\u0435\u0439} \u0430\u043c \u0446I\u0438\u0439\u0438 \u0438\u043d\u0441\u0430\u043d\u0440\u0438\u043a\u0430\u0439 \u044f..\r\n\r\n7. \u0442\u0430\u043b\u0443\u043a\u044c; \u0433\u044c\u0430\u043a\u044a\u0438\u043d\u0434\u0430\u0439; {\u043a \u0432\u043e\u043f\u0440\u043e\u0441\u0443 }\u043c\u0435\u0441\u044d\u043b\u0430\u0434\u0438\u0437 \u0442\u0430\u043b\u0443\u043a\u044c..\r\n\r\n8. \u2013\u0430\u0439; {\u043a \u043c\u043e\u0435\u043c\u0443 \u0441\u0447\u0430\u0441\u0442\u044c\u044e,} \u0437\u0438 \u0431\u0430\u0445\u0442\u0443\u043d\u0430\u0439; {\u043a \u0441\u043e\u0436\u0430\u043b\u0435\u043d\u0438\u044e} \u0433\u044c\u0430\u0439\u0438\u0444.","parse_mode":"Markdown"}}]Array
